member.remarks:
If the RecordCount value is 0, there are no objects in the collection.  You can use this property to easily	iterate through the records in the file i.e.
            
            
            for (int i = 0; i < shp.RecordCount; i++}
            {
                // Do some stuff here
                shp.MoveNext();
            }
            
            
            For i as Integer = 0 To shp.RecordCount - 1 
                ' Do some stuff here
                shp.MoveNext()
            Next i

